    names = names.flat()

    function Counter(string) {
        array = string.split("");
        var count = {};
        array.forEach(val => count[val] = (count[val] || 0) + 1);
        return count;
    }


    function canBeMade(c1, c2) {
        for (const letter in c1) {
            if (!c2.hasOwnProperty(letter)) return false;
            if (c1[letter] > c2[letter]) return false;
        }
        return true;
    }

    function isEmptyCounter(counter) {
        for (const letter in counter) {
            if (counter[letter] != 0) return false;
        }
        return true;
    }

    function counterDifference(c1, c2) {
        var res = {}
        for (const letter in c1) {
            if (!c2.hasOwnProperty(letter)) res[letter] = c1[letter];
            else res[letter] = c1[letter] - c2[letter];
        }
        return res;
    }

    function anagramFinder(input, terms, idx) {
        if (isEmptyCounter(input)) return [[]];
        var ans = []
        for (var i = idx; i < terms.length; i++) {
            if (canBeMade(terms[i][0], input)) {
                res = anagramFinder(counterDifference(input, terms[i][0]), terms, i);
                for (var j = 0; j < res.length; j++) {
                    res[j].push(terms[i][1]);
                    ans.push(res[j]);
                }
            }
        }
        return ans;
    }

    function anagramSolver(input_string, names) {
        inputCounter = Counter(input_string);
        nameListCounter = names.map(x => [Counter(x), x]);
        result = anagramFinder(inputCounter, nameListCounter, 0);
        ansString = "";
        for (var i = 0; i < result.length; i++) {
            for (var j = 0; j < result[i].length; j++) {
                ansString += result[i][j] + ", ";
            }
            ansString += " | ";
        }
        return ansString;
    }

    var result = anagramSolver(input, names);
    if (result == "") result = "No result found";
    document.getElementById("output").innerHTML = result
